import { allProductsActions } from "../store/all-products-slice";
import { useDispatch, useEffect } from "react-redux/es/exports";

const useFetchProducts = () => {
  const dispatch = useDispatch();

  useEffect(fetch(
    "https://abstrakt-5e25f-default-rtdb.europe-west1.firebasedatabase.app/products.json"
  )
    .then((response) => {
      return response.json();
    })
    .then((data) => dispatch(allProductsActions.insertProducts(data))), [dispatch])
  
};

export default useFetchProducts;
